import React from 'react';
import './App.css';

function Header() {
  return (
    <header>
        <div className ='header'>
            <div className="btn-light" >Home</div>
            <div className="btn-light" >About</div>
            <div className="btn-light" >Product</div>
        </div>
    </header>
  );
}

export default Header;
